import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";

export default function Navbar() {
  const linkStyle = {
    margin: "1rem",
    textDecoration: "none",
  };
  return (
    <div>
      <nav className="navbar">
        <Link className="title" to="/" activeClassName="main-nav-active">
          Go Travel
        </Link>

        <ul className="menuContain">
          <li className="logIn">
            <NavLink
              to="/Login"
              className="menuitems"
              activeClassName="main-nav-active"
            >
              Log-In
            </NavLink>
          </li>
          <li className="myList">
            <NavLink
              to="/#"
              className="menuitems"
              activeClassName="main-nav-active"
            >
              {" "}
              My List
            </NavLink>
          </li>
          <li className="posting">
            <NavLink
              to="/Gallery"
              className="menuitems"
              activeClassName="main-nav-active"
            >
              {" "}
              Post My Tri
            </NavLink>
          </li>
          <li className="singIn">
            <NavLink
              to="/Joinus"
              className="menuitems"
              activeClassName="main-nav-active"
              activeStyle
            >
              {" "}
              Sing-In
            </NavLink>
          </li>
        </ul>

        <div></div>

        <i className="fas fa-search"></i>
      </nav>
    </div>
  );
}

